private int vIntListByteSize(int [] ints) {
  int byteSize = 0;
  int last = 0;
  for (int i = 0; i < ints.length; i++) {
    byteSize += vIntByteSize(ints[i] - last);
    last = ints[i];
  }
  return byteSize;
}

